CREATE PROCEDURE [dbo].[SP_PREPARE_XML_DATA_TABLE]
AS
BEGIN
	BEGIN TRAN CREATE_TABLE
	BEGIN TRY
		/*Check, if the A_XML_TABLE_FIELD_DATA table exists*/
		IF EXISTS (SELECT *FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'A_XML_TABLE_FIELD_DATA')
			BEGIN
			    DROP TABLE dbo.A_XML_TABLE_FIELD_DATA;
			END
			
		CREATE TABLE dbo.A_XML_TABLE_FIELD_DATA (
			XML_NAME VARCHAR(128) NOT NULL,
			TABLE_NAME VARCHAR(128) NOT NULL,
			FIELD_NAME VARCHAR(128) NOT NULL,
			CONSTRAINT PK_XML_TABLE_FILED_DATA PRIMARY KEY (XML_NAME,TABLE_NAME,FIELD_NAME)
		);

		/*Insert list tables, fields according to xml data file*/






		COMMIT TRAN;
	END TRY
	BEGIN CATCH
		PRINT 'INSERT TRANSACTION WAS ROLLBACKED'
		ROLLBACK TRAN CREATE_TABLE;
	END CATCH

	
END





GO
